Num = ''
Cal = 1
lsnum = []
Show = []
Topnum = 0
R = 0
End = []
P = " x "
Loop = 0
while R == 0:
    for R1 in Num:
        R1 = int(R1)
        lsnum.append(R1)
        if len(lsnum) == 8:
            Cal = 1
            for R2 in lsnum:
                Cal = Cal*R2
            Show.append(Cal)
            
            if Loop == 1:
                if Cal == Topnum:
                    for R3 in lsnum:
                        End.append(str(R3))
                        R=1
            lsnum.pop(0)
    Topnum = max(Show)
    Loop =1

    
print("ตัวเลขที่ติดกัน 8 ตัวเมื่อนำมาคูณแล้วมีค่ามากที่สุดก็ คือ %s = %d "%(P.join(End),max(Show)))